import React, { Component } from 'react';

import shareScreen from "../../pictures/sharescreen.png";
import stopShare from "../../pictures/stopshare.png";
import acrobat from "../../pictures/acrobat.png";



class Page12 extends Component {

    state = {
        text: {}
    }
    
    handleScroll=()=>{
        window.scroll({top:0,behavior:'smooth'})
    
    }
    componentDidMount() {
        this.handleScroll()
    }
  
    render() {
        return (
            <div className="sheet">
                <div id="page12" className="left">
                    <h1 id="p12title" className="bold center">Sharing about mentoring</h1>
                    <br />
                    <h2>You have the option of sharing information about what we did in mentoring with someone who supports you. </h2>
                    <h2>Do you think you want to do that this week?  It’s your choice if you would like to share about what you’re learning, or not, with someone who you really trust like a family member, teacher, or counselor. If you do want to share, then I’ll have you fill out a short worksheet!  If you don’t want to share, that’s okay too! </h2>
                    <br/><br/>
                    <div className="custom_svg demo_box" id="inst_1_12">
                        <h2 className="in_inst">If they want to share, click the link for the worksheet</h2>
                    </div>
                    <img src={acrobat} alt="PDF file" id="acrobat12" />
                    <br/><br/><br/><br/>
                    <div className="custom_svg demo_box" id="inst_2_12">
                        <h2 className="in_inst">Share your screen</h2>
                    </div>
                    <img src={shareScreen} alt="Share screen" id="shareScreen12" />
                    <br/><br/><br/><br/><br/><br/>
                    <div className="custom_svg demo_box" id="inst_3_12">
                        <h2 className="in_inst">When you are finished, stop sharing your screen</h2>
                    </div>
                    <img src={stopShare} alt="Stop sharing" id="stopShare12" />
                </div>
            </div>
        )
    }
}
export default Page12;
